import icon1 from "../assets/icon1.png";
import icon2 from "../assets/icon2.png";
import icon3 from "../assets/icon3.png";
import icon4 from "../assets/icon4.png";

const cardsapi = [
  {
    id: 1,
    text1: 'BUDGET',
    text2: 'FRIENDLY',
    imgsrc: icon1,
  },
  {
    id: 2,
    text1: 'ON-SITE/ONLINE',
    text2: 'SESSION',
    imgsrc: icon2,
  },
  {
    id: 3,
    text1: 'GET CERTIFIED',
    text2: 'BY TECHROCTICS',
    imgsrc: icon3,
  },
  {
    id: 4,
    text1: '3 TO 6 MONTHS',
    text2: 'TRAINING',
    imgsrc: icon4,
  },
]

export default cardsapi
